import './App.css';
import Navbar from './Components/navbar/Navbar'
import Header from './Components/header/Header'
import Brand from './Components/brands/Brand'

function App() {
  return (
    <div className="App">
    <div className="gradient__bg">
      <Navbar />
      <Header />
     </div>
     <Brand />
    </div>
  );
}

export default App;
